import{_ as a,c as A,o as t,a2 as r}from"./chunks/framework.Bc4oNHcE.js";const e="/assets/d69109be-a41e-4706-a03f-1f6260f46359.Bu9LwmwB.png",o="data:image/png;base64,",i="data:image/png;base64,",l="data:image/png;base64,",h="data:image/png;base64,",s="/assets/1f5856a8-5aad-4a98-bd81-28c29c9d0044.DG_AvLuj.png",g=JSON.parse('{"title":"01行列式","description":"","frontmatter":{"layout":"doc","title":"01行列式"},"headers":[],"relativePath":"math/线性代数/01行列式.md","filePath":"math/线性代数/01行列式.md"}'),n={name:"math/线性代数/01行列式.md"},d=r('<h1 id="行列式" tabindex="-1">行列式 <a class="header-anchor" href="#行列式" aria-label="Permalink to &quot;行列式&quot;">​</a></h1><h2 id="二元线性方程组和二阶行列式" tabindex="-1">二元线性方程组和二阶行列式 <a class="header-anchor" href="#二元线性方程组和二阶行列式" aria-label="Permalink to &quot;二元线性方程组和二阶行列式&quot;">​</a></h2><p><img src="'+e+'" alt="二元线性方程组和二阶行列式"></p><blockquote><p>当且仅当分母不等于0时，存在唯一解。</p></blockquote><h2 id="三阶行列式" tabindex="-1">三阶行列式 <a class="header-anchor" href="#三阶行列式" aria-label="Permalink to &quot;三阶行列式&quot;">​</a></h2><p><img src="'+o+'" alt="三阶行列式"></p><blockquote><p>三阶行列式和二阶行列式遵从对角线法则</p></blockquote><h2 id="对角线法则" tabindex="-1">对角线法则 <a class="header-anchor" href="#对角线法则" aria-label="Permalink to &quot;对角线法则&quot;">​</a></h2><p>平行于主对角线的乘积和减去平行于副对角线乘积和 主对角线：行标等于列标元素的连线 副对角线：垂直于主对角线的连线</p><h2 id="排列-全排列" tabindex="-1">排列[全排列] <a class="header-anchor" href="#排列-全排列" aria-label="Permalink to &quot;排列[全排列]&quot;">​</a></h2><blockquote><p>n个不同元素排成一列，叫做n个元素的全排列</p></blockquote><h2 id="逆序数" tabindex="-1">逆序数 <a class="header-anchor" href="#逆序数" aria-label="Permalink to &quot;逆序数&quot;">​</a></h2><blockquote><p>对于n个元素，先规定各个元素之间存在一个标准次序，然后在这n个元素中的任一排列中，当某一对元素的先后顺序于标准次序不同时，就够成一个逆序。所有逆序的总数称为这个排列的逆序数。</p></blockquote><h3 id="奇排列-逆序数为奇数的排列" tabindex="-1">奇排列： 逆序数为奇数的排列 <a class="header-anchor" href="#奇排列-逆序数为奇数的排列" aria-label="Permalink to &quot;奇排列： 逆序数为奇数的排列&quot;">​</a></h3><h3 id="偶排列-逆序数为偶数的排列" tabindex="-1">偶排列： 逆序数为偶数的排列 <a class="header-anchor" href="#偶排列-逆序数为偶数的排列" aria-label="Permalink to &quot;偶排列： 逆序数为偶数的排列&quot;">​</a></h3><h3 id="示例" tabindex="-1">示例 <a class="header-anchor" href="#示例" aria-label="Permalink to &quot;示例&quot;">​</a></h3><p>问: 求32514的逆序数 解: 3在最前面所以逆序数为0 2的前面有一个3比2大所以逆序数为1 5为最大数逆袭数为0 1位最小数逆序数为3 4位的逆序一个1 共计 0 + 1 + 0 + 3 + 1 = 5</p><h2 id="兑换" tabindex="-1">兑换 <a class="header-anchor" href="#兑换" aria-label="Permalink to &quot;兑换&quot;">​</a></h2><blockquote><p>在某一排列中，将任意2个元素兑换，其余元素不动，这种构造出新排列的手续叫对换 将相邻2个元素进行对换称为相邻对换</p></blockquote><h3 id="定理" tabindex="-1">定理 <a class="header-anchor" href="#定理" aria-label="Permalink to &quot;定理&quot;">​</a></h3><blockquote><ol><li>一个排列中的任意2个元素进行对换，排列的奇偶行发生变化</li><li>奇排列对换成标准排列的次数为奇数,偶排列对换成标准排列的次数为偶数</li></ol></blockquote><h2 id="n阶行列式" tabindex="-1">n阶行列式 <a class="header-anchor" href="#n阶行列式" aria-label="Permalink to &quot;n阶行列式&quot;">​</a></h2><p><img src="'+i+'" alt="n阶行列式"></p><blockquote><p>其中t为p1,p2,p3...pn组成的排列的逆序数</p></blockquote><h3 id="上-下-三角形行列式" tabindex="-1">上(下)三角形行列式 <a class="header-anchor" href="#上-下-三角形行列式" aria-label="Permalink to &quot;上(下)三角形行列式&quot;">​</a></h3><blockquote><p>主对角线以上或者以下的元素全为0的行列式 <img src="'+l+'" alt="上(下)对角行列式"></p></blockquote><h3 id="对角行列式" tabindex="-1">对角行列式 <a class="header-anchor" href="#对角行列式" aria-label="Permalink to &quot;对角行列式&quot;">​</a></h3><blockquote><p>主对角线以上和以下的元素全为0的行列式 <img src="'+h+'" alt="对角线行列式"></p></blockquote><h2 id="行列式的性质" tabindex="-1">行列式的性质 <a class="header-anchor" href="#行列式的性质" aria-label="Permalink to &quot;行列式的性质&quot;">​</a></h2><h3 id="转置行列式" tabindex="-1">转置行列式 <a class="header-anchor" href="#转置行列式" aria-label="Permalink to &quot;转置行列式&quot;">​</a></h3><blockquote><p>将行列式的行和列进行对换构成的行列式</p></blockquote><h3 id="性质1-行列式和他的转置行列式相等" tabindex="-1">[性质1] 行列式和他的转置行列式相等 <a class="header-anchor" href="#性质1-行列式和他的转置行列式相等" aria-label="Permalink to &quot;[性质1] 行列式和他的转置行列式相等&quot;">​</a></h3><h3 id="性质2-行列式的2行-列-进行对换-行列式变号" tabindex="-1">[性质2] 行列式的2行(列)进行对换，行列式变号 <a class="header-anchor" href="#性质2-行列式的2行-列-进行对换-行列式变号" aria-label="Permalink to &quot;[性质2] 行列式的2行(列)进行对换，行列式变号&quot;">​</a></h3><h3 id="推论2-如果行列式有2行-列-完全相同-则此行列式为0" tabindex="-1">[推论2] 如果行列式有2行(列)完全相同，则此行列式为0 <a class="header-anchor" href="#推论2-如果行列式有2行-列-完全相同-则此行列式为0" aria-label="Permalink to &quot;[推论2] 如果行列式有2行(列)完全相同，则此行列式为0&quot;">​</a></h3><h3 id="性质3-行列式的某一行-列-中的所有元素同乘一个数-等于k乘此行列式" tabindex="-1">[性质3] 行列式的某一行(列)中的所有元素同乘一个数，等于k乘此行列式 <a class="header-anchor" href="#性质3-行列式的某一行-列-中的所有元素同乘一个数-等于k乘此行列式" aria-label="Permalink to &quot;[性质3] 行列式的某一行(列)中的所有元素同乘一个数，等于k乘此行列式&quot;">​</a></h3><h3 id="推论3-行列式中某一行-列-中的所有元素的公因子可以提到行列式的外面" tabindex="-1">[推论3] 行列式中某一行(列)中的所有元素的公因子可以提到行列式的外面 <a class="header-anchor" href="#推论3-行列式中某一行-列-中的所有元素的公因子可以提到行列式的外面" aria-label="Permalink to &quot;[推论3] 行列式中某一行(列)中的所有元素的公因子可以提到行列式的外面&quot;">​</a></h3><h3 id="性质4-行列式中有2行-列-元素成比例-此行列式为0" tabindex="-1">[性质4] 行列式中有2行(列)元素成比例，此行列式为0 <a class="header-anchor" href="#性质4-行列式中有2行-列-元素成比例-此行列式为0" aria-label="Permalink to &quot;[性质4] 行列式中有2行(列)元素成比例，此行列式为0&quot;">​</a></h3><h3 id="性质5-行列式中某一行-列-中的所有元素都是2数之和-则此行列式等于2个行列式之和" tabindex="-1">[性质5] 行列式中某一行(列)中的所有元素都是2数之和，则此行列式等于2个行列式之和 <a class="header-anchor" href="#性质5-行列式中某一行-列-中的所有元素都是2数之和-则此行列式等于2个行列式之和" aria-label="Permalink to &quot;[性质5] 行列式中某一行(列)中的所有元素都是2数之和，则此行列式等于2个行列式之和&quot;">​</a></h3><p><img src="'+s+'" alt="性质5"></p><h3 id="性质6-行列式中某一行-列-中的所有元素乘一个数加到另外一行-列-中-行列式不变" tabindex="-1">[性质6] 行列式中某一行(列)中的所有元素乘一个数加到另外一行(列)中，行列式不变 <a class="header-anchor" href="#性质6-行列式中某一行-列-中的所有元素乘一个数加到另外一行-列-中-行列式不变" aria-label="Permalink to &quot;[性质6] 行列式中某一行(列)中的所有元素乘一个数加到另外一行(列)中，行列式不变&quot;">​</a></h3><h2 id="行列式按照行和列展开" tabindex="-1">行列式按照行和列展开 <a class="header-anchor" href="#行列式按照行和列展开" aria-label="Permalink to &quot;行列式按照行和列展开&quot;">​</a></h2><h3 id="余子式" tabindex="-1">余子式 <a class="header-anchor" href="#余子式" aria-label="Permalink to &quot;余子式&quot;">​</a></h3><blockquote><p>在n阶行列式中，把(i,j)元a<sub>ij</sub>所在的第i行和第J列划去后，留下的n-1阶行列式叫做(i,j)元a<sub>ij</sub>的余子式，记作<strong>M</strong><sub>ij</sub></p></blockquote><h3 id="代数余子式" tabindex="-1">代数余子式 <a class="header-anchor" href="#代数余子式" aria-label="Permalink to &quot;代数余子式&quot;">​</a></h3><blockquote><p><strong>A</strong><sub>ij</sub> = (-1)<sup>i+j</sup><strong>M</strong><sub>ij</sub>; <strong>A</strong><sub>ij</sub>叫做a<sub>ij</sub>的代数余子式</p></blockquote><h3 id="一个n阶行列式-如果其中第i行中所有元素除-i-j-元aij外都是0-那么行列式等于aij与他的代数余子式的乘积" tabindex="-1">一个n阶行列式，如果其中第i行中所有元素除(i,j)元a<sub>ij</sub>外都是0，那么行列式等于a<sub>ij</sub>与他的代数余子式的乘积 <a class="header-anchor" href="#一个n阶行列式-如果其中第i行中所有元素除-i-j-元aij外都是0-那么行列式等于aij与他的代数余子式的乘积" aria-label="Permalink to &quot;一个n阶行列式，如果其中第i行中所有元素除(i,j)元a&lt;sub&gt;ij&lt;/sub&gt;外都是0，那么行列式等于a&lt;sub&gt;ij&lt;/sub&gt;与他的代数余子式的乘积&quot;">​</a></h3><blockquote><p>D = a<sub>ij</sub><strong>A</strong><sub>ij</sub></p></blockquote><h3 id="行列式等于他的任一行-列-的各元素与其对应的代数余子式乘积之和" tabindex="-1">行列式等于他的任一行(列)的各元素与其对应的代数余子式乘积之和 <a class="header-anchor" href="#行列式等于他的任一行-列-的各元素与其对应的代数余子式乘积之和" aria-label="Permalink to &quot;行列式等于他的任一行(列)的各元素与其对应的代数余子式乘积之和&quot;">​</a></h3>',48),q=[d];function u(p,c,b,V,v,f){return t(),A("div",null,q)}const U=a(n,[["render",u]]);export{g as __pageData,U as default};
